const CartDropdown = () => {
    return(
        <div className='cart-dropdown-container'>
            <div className='cart-items'>
                <CartItem name={"name"}/>
                {[]}
            </div>
            <Button>GO TO CHECKOUT</Button>
        </div>
    );
}

export default CartDropdown;
